/** Application page one component. */
import React from 'react'
export default class MainImage extends React.Component {
    componentDidMount = () => {
        this.timeoutHandle = setTimeout(() => {
            window.location.href = '/index';
        }, 3000);
    };
    componentWillUnmount = () => {
        clearTimeout(this.timeoutHandle);
    }
    render() {
        return (
            //<div className = 'lunaWeb'/>
            <div>Welcome
            <style jsx>{`
            div {
                margin: 0;
                width: 100%;
                height: 100%;
                background: url(../static/lunaBack.png) center center no-repeat,  url(../img/starSky.png);
                background-size: 600px, cover;
            }
            `}</style>
            </div>

        )
